export default function NavButton(){

    return (
        <aside className="NavBar">
            <h1>
                <div className="NavButton">About</div>
                <div className="NavButton">Contact</div>
                <div className="NavButton">Portfolio</div>
                <div className="NavButton">Resume</div> 
            </h1>
        </aside>

    )

}
